text:
one our favorite episodes of the lunch table podcast, the table gets a surprise visit from star basketball player, @mauricewatson10. having led @bluejaymbb to the number 7 rank in the @ncaasports with a 17-1 record, maurice tragically tore his acl in the 19th game of his final collegiate season. from there, it all went south for maurice as he suddenly found himself being accused of sexually assaulting a fellow student at #creighton. we explore maurice's trials and tribulations during his return from injury, falsified sexual assault accusations, and countless other set backs. maurice provides us insight into the raw details of his rough upbringing in #philadelphia, his split collegiate basketball career at both @bostonu and @bluejaymbb, his road to recovery, and his painful and eye-opening experiences dealing with the #us justice system during the apex of the #metoo movement. maurice highlights the importance of concrete friendships, family, and an unwavering faith in #god. he is now playing professional #basketball in the #fiba europe cup league in holland and still maintains his childhood dream of playing in the @nba. the maurice watson story has only been told to the lunch table podcast, so tune in for this rollercoaster ride of emotions! (episode link in the bio) 
@rawtruthradio 
